import './App.css';
import Home from "./page/Home"
import { Routes, Route } from "react-router-dom";
function App() {
  return (
    <>
      <Routes>
        <Route exact path="/" element={<Home />} />
       />
      </Routes>
    </>
  );
}

export default App;
